    "If the course does not have an end date, learners always see their scores when they submit answers to assessments.": "Je\u015bli kurs nie posiada daty zako\u0144czenia, studenci zawsze zobacz\u0105 swoje wyniki po przes\u0142aniu odpowiedzi na zadania.",
    "If the photos you submit are rejected, try moving the computer or camera orientation to change the lighting angle.  The most common reason for rejection is inability to read the text on the ID card.": "Si les photos que vous soumettez sont rejet\u00e9es, essayez de d\u00e9placer l'ordinateur ou l'appareil photo pour changer l'angle d'\u00e9clairage. Le motif de rejet le plus fr\u00e9quent est l'incapacit\u00e9 de lire le texte de la carte d'identit\u00e9.",
    "If the subsection does not have a due date, learners always see their scores when they submit answers to assessments.": "Je\u015bli lekcja nie posiada terminu ko\u0144cowego, studenci zawsze zobacz\u0105 swoje wyniki po przes\u0142aniu odpowiedzi na zadania.",
    "If the unit was previously published and released to learners, any changes you made to the unit when it was hidden will now be visible to learners.": "Je\u015bli ten ekran zosta\u0142 wcze\u015bniej opublikowany i upubliczniony dla student\u00f3w, wszystkie zmiany, jakich dokona\u0142e\u015b kiedy ekran by\u0142 ukryty, b\u0119d\u0105 teraz widoczne dla student\u00f3w.",
    "If the unit was previously published and released to students, any changes you made to the unit when it was hidden will now be visible to students. Do you want to proceed?": "Si l'unit\u00e9 a d\u00e9j\u00e0 \u00e9t\u00e9 publi\u00e9e et diffus\u00e9e aux \u00e9tudiants, tous les changements apport\u00e9s \u00e0 l'unit\u00e9 pendant qu' elle \u00e9tait cach\u00e9e seront d\u00e9sormais visibles par les \u00e9tudiants. Voulez-vous continuer?",
    "If you do not yet have an account, use the button below to register.": "Je\u015bli nie posiadasz konta, u\u017cyj poni\u017cszego przycisku, aby si\u0119 zarejestrowa\u0107.",
    "If you leave this page without saving or submitting your response, you will lose any work you have done on the response.": "Je\u017celi opu\u015bcisz t\u0119 stron\u0119 bez zapisania lub przes\u0142ania swojej odpowiedzi, stracisz ca\u0142\u0105 swoj\u0105 prac\u0119.",
    "If you leave this page without submitting your peer assessment, you will lose any work you have done.": "Je\u017celi opu\u015bcisz t\u0119 stron\u0119 bez przes\u0142ania zadania do oceny, stracisz ca\u0142\u0105 swoj\u0105 prac\u0119.",
    "If you leave this page without submitting your self assessment, you will lose any work you have done.": "Je\u017celi opu\u015bcisz t\u0119 stron\u0119 bez przes\u0142ania swojego zadania, stracisz ca\u0142\u0105 swoj\u0105 prac\u0119.",
    "If you leave this page without submitting your staff assessment, you will lose any work you have done.": "Je\u017celi opu\u015bcisz t\u0119 stron\u0119 bez przes\u0142ania oceny, stracisz ca\u0142\u0105 swoj\u0105 prac\u0119.",
    "If you make significant changes, make sure you notify members of the team before making these changes.": "Je\u015bli chcesz wprowadzi\u0107 znacz\u0105ce zmiany, pami\u0119taj o wcze\u015bniejszym poinformowaniu o tym zamiarze pozosta\u0142ych cz\u0142onk\u00f3w zespo\u0142u.",
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "Je\u015bli zaznaczysz, \u017ce ta %(xblockType)s jest widoczna dla student\u00f3w, b\u0119d\u0105 oni widzie\u0107 jej zawarto\u015b\u0107 po opublikowaniu i osi\u0105gni\u0119ciu daty upublicznienia. Wy\u0142\u0105cznie ekrany oznaczone jako ukryte przed studentami pozostan\u0105 ukryte po wy\u0142\u0105czeniu przez ciebie tej opcji dla %(xblockType)s.",
    "If you remove this transcript, the transcript will not be available for any components that use this video.": "Je\u015bli usuniesz t\u0119 transkrypcj\u0119, b\u0119dzie ona niedost\u0119pna dla element\u00f3w wykorzystuj\u0105cych ten film.",
    "If you remove this transcript, the transcript will not be available for this component.": "Si vous supprimez cette transcription, la transcription ne sera pas disponible pour ce composant.",
    "If you require assistance with taking either photo for submission, contact %(platformName)s support for additional suggestions.": "Si vous avez besoin d'aide pour prendre l'une ou l'autre des photos \u00e0 soumettre, contactez le support de %(platformName)s pour des suggestions suppl\u00e9mentaires.",
    "If you select an option other than \"%(hide_label)s\", published units in this subsection become available to learners unless they are explicitly hidden.": "Je\u015bli wybierzesz opcj\u0119 inn\u0105 ni\u017c \"%(hide_label)s\", opublikowane ekrany w tej lekcji stan\u0105 si\u0119 dost\u0119pne dla student\u00f3w, chyba, \u017ce s\u0105 oznaczone jako ukryte.",
    "If you still wish to continue and delete your account, please enter your account password:": "Si vous souhaitez toujours supprimer votre compte, veuillez saisir le mot de passe de votre compte :",
    "If you use the Advanced Editor, this problem will be converted to XML and you will not be able to return to the Simple Editor Interface.\n\nProceed to the Advanced Editor and convert this problem to XML?": "Si vous utilisez l'\u00e9diteur avanc\u00e9, ce probl\u00e8me sera converti en XML et vous ne serez plus en mesure de revenir \u00e0 l'interface d'\u00e9dition simple.\nPasser \u00e0 l'\u00e9diteur avanc\u00e9 et convertir ce probl\u00e8me en XML?",
