    "To review learner cohort assignments or see the results of uploading a CSV file, download course profile information or cohort results on the {link_start}Data Download{link_end} page.": "Aby sprawdzi\u0107 przydzia\u0142 student\u00f3w do kohort lub pozna\u0107 efekty za\u0142adowania pliku CSV, pobierz informacje profilowe z kursu lub przegl\u0105d kohort ze strony {link_start}pobierania danych{link_end}.",
