    "Use cohorts as the basis for dividing discussions. All learners, regardless of cohort, see the same discussion topics, but within divided topics, only members of the same cohort see and respond to each others\u2019 posts. ": "U\u017cywaj kohort jako podstawy do dzielenia dyskusji. Wszyscy studenci, niezale\u017cnie od ich kohorty, widz\u0105 te same tematy dyskusji, natomiast wpisy wewn\u0105trz podzielonych dyskusji widz\u0105 wy\u0142\u0105cznie studenci b\u0119d\u0105cy w tej samej kohorcie.",
