    "We've sent a confirmation message to {new_email_address}. Click the link in the message to update your email address.": "Wys\u0142ali\u015bmy wiadomo\u015b\u0107 potwierdzaj\u0105c\u0105 na adres {new_email_address}. Kliknij \u0142\u0105cze znajduj\u0105ce si\u0119 w jej tre\u015bci, aby zaktualizowa\u0107 sw\u00f3j adres e-mail.",
    "We've sent a confirmation message to {new_secondary_email_address}. Click the link in the message to update your secondary email address.": "Un message de confirmation a \u00e9t\u00e9 envoy\u00e9 \u00e0 {new_secondary_email_address}. Cliquez sur le lien dans le message pour mettre \u00e0 jour votre adresse email secondaire.",
    "We've sent a message to {email}. Click the link in the message to reset your password. Didn't receive the message? Contact {anchorStart}technical support{anchorEnd}.": "Na adres {email} zosta\u0142a wys\u0142ana wiadomo\u015b\u0107. Kliknij w odno\u015bnik w wiadomo\u015bci, aby zresetowa\u0107 has\u0142o. Je\u015bli wiadomo\u015b\u0107 nie dotar\u0142a, skontaktuj si\u0119 z {anchorStart}pomoc\u0105 techniczn\u0105{anchorEnd}.",
